N:	Not Present:	Activity or condition does not exist;

O:	Occasionally:	Activity or condition exists up to 1/3 of the time;

F:	Frequently:	Activity or condition exists from 1/3 to 2/3 of the time;

C:	Constantly:	Activity or condition exist 2/3 or more of the time.



Strength is coded as S (Sedentary), L (light), M (Medium), H (Heavy), and V (Very Heavy).



Environmental Conditions are a means of describing the physical surroundings of a worker in a specific job and of indicating the hazards that pose a definite risk of bodily injury to the worker. The environmental condition identified for an occupation are those which are considered to be important or critical. Environmental Conditions can be expressed, with the exception of Noise Intensity Level, in the same manner as physical demands.

Noise Intensity is rated as: 1  Very Quiet;  2 Quiet;  3 Moderate;  4 Loud;   5 Very Loud.
